import { useEffect, useState } from 'react';
import { getPlayers, getTeams, reportSummary } from './api';

export default function Report() {
  const [teams, setTeams] = useState([]);
  const [players, setPlayers] = useState([]);
  const [filters, setFilters] = useState({
    start_date: '',
    end_date: '',
    team_ids: [],
    player_ids: [],
    min_stake: '',
    max_stake: '',
    status: '',
  });
  const [stats, setStats] = useState(null);

  useEffect(() => {
    (async () => {
      const [t, p] = await Promise.all([getTeams(), getPlayers()]);
      setTeams(t);
      setPlayers(p);
    })();
  }, []);

  async function runReport() {
    const payload = {
      ...filters,
      start_date: filters.start_date || null,
      end_date: filters.end_date || null,
      team_ids: filters.team_ids.length ? filters.team_ids.map(Number) : null,
      player_ids: filters.player_ids.length ? filters.player_ids.map(Number) : null,
      min_stake: filters.min_stake === '' ? null : Number(filters.min_stake),
      max_stake: filters.max_stake === '' ? null : Number(filters.max_stake),
      status: filters.status || null,
    };
    const s = await reportSummary(payload);
    setStats(s);
  }

  function toggleMulti(listKey, id) {
    setFilters(prev => {
      const list = new Set(prev[listKey]);
      if (list.has(id)) list.delete(id); else list.add(id);
      return { ...prev, [listKey]: Array.from(list) };
    });
  }

  return (
    <div style={{ display: 'grid', gap: 16 }}>
      <h2>Report</h2>
      <div style={{ display: 'grid', gap: 8 }}>
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(2, 1fr)', gap: 8 }}>
          <label>
            Start Date
            <input type="date" value={filters.start_date} onChange={e => setFilters({ ...filters, start_date: e.target.value })} />
          </label>
          <label>
            End Date
            <input type="date" value={filters.end_date} onChange={e => setFilters({ ...filters, end_date: e.target.value })} />
          </label>
        </div>
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(2, 1fr)', gap: 8 }}>
          <label>
            Min Stake
            <input type="number" step="0.01" value={filters.min_stake} onChange={e => setFilters({ ...filters, min_stake: e.target.value })} />
          </label>
          <label>
            Max Stake
            <input type="number" step="0.01" value={filters.max_stake} onChange={e => setFilters({ ...filters, max_stake: e.target.value })} />
          </label>
        </div>
        <label>
          Status
          <select value={filters.status} onChange={e => setFilters({ ...filters, status: e.target.value })}>
            <option value="">Any</option>
            <option value="pending">pending</option>
            <option value="won">won</option>
            <option value="lost">lost</option>
          </select>
        </label>

        <div>
          <div><strong>Teams</strong></div>
          <div style={{ display: 'flex', flexWrap: 'wrap', gap: 8 }}>
            {teams.map(t => (
              <label key={t.id} style={{ border: '1px solid #ccc', padding: '4px 8px', borderRadius: 4 }}>
                <input type="checkbox" checked={filters.team_ids.includes(String(t.id))}
                  onChange={() => toggleMulti('team_ids', String(t.id))} /> {t.name}
              </label>
            ))}
          </div>
        </div>

        <div>
          <div><strong>Players</strong></div>
          <div style={{ display: 'flex', flexWrap: 'wrap', gap: 8 }}>
            {players.map(p => (
              <label key={p.id} style={{ border: '1px solid #ccc', padding: '4px 8px', borderRadius: 4 }}>
                <input type="checkbox" checked={filters.player_ids.includes(String(p.id))}
                  onChange={() => toggleMulti('player_ids', String(p.id))} /> {p.name}
              </label>
            ))}
          </div>
        </div>

        <button onClick={runReport}>Run Report</button>
      </div>

      {stats && (
        <div style={{ borderTop: '1px solid #ccc', paddingTop: 8 }}>
          <h3>Summary</h3>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: 8 }}>
            <Stat label="Total Parlays" value={stats.total_parlays} />
            <Stat label="Won" value={stats.won_parlays} />
            <Stat label="Lost" value={stats.lost_parlays} />
            <Stat label="Pending" value={stats.pending_parlays} />
            <Stat label="Success Rate" value={(stats.success_rate * 100).toFixed(1) + '%'} />
            <Stat label="Average Stake" value={`$${stats.average_stake.toFixed(2)}`} />
            <Stat label="Total Staked" value={`$${stats.total_staked.toFixed(2)}`} />
            <Stat label="Total Returned" value={`$${stats.total_returned.toFixed(2)}`} />
            <Stat label="Net Profit" value={`$${stats.net_profit.toFixed(2)}`} />
            <Stat label="ROI" value={(stats.roi * 100).toFixed(1) + '%'} />
          </div>
        </div>
      )}
    </div>
  );
}

function Stat({ label, value }) {
  return (
    <div style={{ border: '1px solid #eee', padding: 12, borderRadius: 6 }}>
      <div style={{ fontSize: 12, color: '#666' }}>{label}</div>
      <div style={{ fontSize: 18, fontWeight: 600 }}>{value}</div>
    </div>
  );
}
